const WRAPPED_ETH_ADDRESS: Address = ... pub struct WrappedETHAddress;
pub struct M1TokenAddress(Address); pub trait MintingAddress { fn get_address(&self) -> &Address;
} impl MintingAddress for WrappedETHAddress { fn get_address(&self) -> &Address { &WRAPPED_ETH_ADDRESS }
} impl MintingAddress for M1TokenAddress { fn get_address(&self) -> &Address { &self.0 }
} /// Generic struct for transferring value from Ethereum
struct TransferFromEthereum<Token: MintingAddress> { /// token address on Ethereum ethereum_address: Address, /// the address on M1 receiving the tokens receiver: Address, /// The M1 token that will be minted token: Token, /// the amount of ETH token to mint amount: Amount, /// minimum number of confirmations needed for mints min_confirmations: u8, /// height of the block at which the message appeared height: u64, /// the hash & height of the last descendant block marked as `seen` latest_descendant: ([u8; 32], u64)
} impl TransferFromEthereum { /// Update the hash and height of the block `B` marked as `seen` in M1 /// storage such that /// 1. `B` is a descendant of the block containing the original message /// 2. `B` has the maximum height of all blocks satisfying 1. fn update_latest_descendant(&mut self, hash: [u8; 32], height: u64) { if height > self.latest_descendant.1 { self.latest_descendant = (hash, height); } } /// Check if the number of confirmations for the block containing /// the original message exceeds the minimum number required to /// consider the message confirmed. fn is_confirmed(&self) -> bool { self.latest_descendant.1 - self.height >= self.min_confirmations }
